import styled from "styled-components";
import '../App.css';
import { Link } from 'react-router-dom';
import {Row, Col} from'react-bootstrap';

const HeaderContainer = styled.div`
  background-color: #A0CED9;
  height: 50px;
  width: 100%;
  display: flex;
  justify-content: space-around;
  align-items: center;
  a{
    height: 100%;
    display: flex;
    align-items: center;
    background-color: #1F2041;
    padding: 0 15px;
    color: white;
    font-size: 20px;
    text-decoration: none;
  }
  a:hover{
    height: 100%;
    display: flex;
    align-items: center;
    background-color: blueviolet;
    transition: 1000ms;
    padding: 0 15px;
    color: white;
    font-size: 20px;
    text-decoration: none;
  }
`

const Header = () => {
  return (
    <HeaderContainer>
      <Row>
        <Col lg={4}>
          xui
        </Col>
      </Row>
      <Link to='/SignIn'>Войти</Link>
      <Link to='/SignIn'>Войти</Link>
      <Link to='/SignIn'>Войти</Link>
    </HeaderContainer>
  );
}

export default Header;
